INSERT INTO `noticias` (`id_noticias`, `texto_noticias`, `id_categorias_noticias`) VALUES
(4, 'Both youngsters will drive similar M-Sport Poland-built Ford Fiesta Rally3 cars on what will be their respective first outings since Rally Sweden in February. Then, it was Korhonen who took the spoils - claiming his maiden WRC3 victory in the process.\r\n\r\nAn equally strong result on Portugal’s tough gravel tracks could propel Korhonen into championship lead, with the 24-year-old also set to compete in next month’s Rally Italia Sardegna (1 - 4 June).\r\n\r\nHerranen, meanwhile, has a score to settle after being hindered by technical troubles in Sweden. The teenager did have the pace to win a number of the snow and ice speed tests, however - something he’ll be eager to repeat this time around.\r\n\r\nThe rally is based in the coastal city of Matosinhos. After Thursday night’s start in Coimbra, crews face 19 speed tests covering 325.35km in north and central Portugal.', 2),
(5, 'Both youngsters will drive similar M-Sport Poland-built Ford Fiesta Rally3 cars on what will be their respective first outings since Rally Sweden in February. Then, it was Korhonen who took the spoils - claiming his maiden WRC3 victory in the process.\r\n\r\nAn equally strong result on Portugal’s tough gravel tracks could propel Korhonen into championship lead, with the 24-year-old also set to compete in next month’s Rally Italia Sardegna (1 - 4 June).\r\n\r\nHerranen, meanwhile, has a score to settle after being hindered by technical troubles in Sweden. The teenager did have the pace to win a number of the snow and ice speed tests, however - something he’ll be eager to repeat this time around.\r\n\r\nThe rally is based in the coastal city of Matosinhos. After Thursday night’s start in Coimbra, crews face 19 speed tests covering 325.35km in north and central Portugal.', 2),
(6, 'Both youngsters will drive similar M-Sport Poland-built Ford Fiesta Rally3 cars on what will be their respective first outings since Rally Sweden in February. Then, it was Korhonen who took the spoils - claiming his maiden WRC3 victory in the process.\r\n\r\nAn equally strong result on Portugal’s tough gravel tracks could propel Korhonen into championship lead, with the 24-year-old also set to compete in next month’s Rally Italia Sardegna (1 - 4 June).\r\n\r\nHerranen, meanwhile, has a score to settle after being hindered by technical troubles in Sweden. The teenager did have the pace to win a number of the snow and ice speed tests, however - something he’ll be eager to repeat this time around.\r\n\r\nThe rally is based in the coastal city of Matosinhos. After Thursday night’s start in Coimbra, crews face 19 speed tests covering 325.35km in north and central Portugal.', 2);

